 16:32","PwdLastSet":"11/21/2022 13:00","Groups":"IT"},{"SamAccountName":"wwade","UserPrincipalName":"wwade@uat.local","Name":"Will Wade                                                   ","Enabled":"TRUE","LastLogon":"","PwdLastSet":"5/22/2019 13:58","Groups":""},{"SamAccountName":"WDubose","UserPrincipalName":"WDubose@uat.local","Name":"William Dubose                                              ","Enabled":"TRUE","LastLogon":"8/19/2022 8:54","PwdLastSet":"8/19/2022 8:54","Groups":""},{"SamAccountName":"WThomas","UserPrincipalName":"WThomas@uat.local","Name":"William Thomas","Enabled":"TRUE","LastLogon":"10/2/2025 14:26","PwdLastSet":"1/2/2025 16:38","Groups":"Atlas Authentication, IT, Remote Desktop Users, Domain Admins"},{"SamAccountName":"XTrujillo","UserPrincipalName":"XTrujillo@uat.local","Name":"Xan Trujillo","Enabled":"TRUE","LastLogon":"11/4/2025 16:08","PwdLastSet":"1/6/2025 15:22","Groups":"JETServiceTier, Citrix Xen 7 - Ulterra Enterprise Apps, IT, Engineering Console Users, Ulterra Enterprise Application Users"},{"SamAccountName":"zsmith","UserPrincipalName":"zsmith@uat.local","Name":"Zach Smith                                                  ","Enabled":"TRUE","LastLogon":"11/9/2025 2:58","PwdLastSet":"1/3/2025 12:10","Groups":"Atlas Authentication, IT, Ulterra Enterprise Application Users, Domain Admins, Schema Admins"},{"SamAccountName":"ZFerris","UserPrincipalName":"ZFerris@uat.local","Name":"Zebulon Ferris","Enabled":"TRUE","LastLogon":"5/9/2024 11:03","PwdLastSet":"5/9/2024 11:03","Groups":""}]
'@

$users = $usersJson | ConvertFrom-Json

Write-Host "Total users to process: $($users.Count)" -ForegroundColor Yellow
Write-Host ""

$createdCount = 0
$existingCount = 0
$errorCount = 0
$defaultPassword = ConvertTo-SecureString "ChangeMe123!" -AsPlainText -Force

foreach ($user in $users) {
    $samAccountName = $user.SamAccountName
    
    # Skip if no SamAccountName
    if ([string]::IsNullOrWhiteSpace($samAccountName)) {
        continue
    }
    
    # Check if user exists
    try {
        $existingUser = Get-ADUser -Identity $samAccountName -ErrorAction Stop
        Write-Host "  Exists: $samAccountName" -ForegroundColor Gray
        $existingCount++
        continue
    } catch {
        # User doesn't exist, create it
    }
    
    # Prepare UPN
    $upn = $user.UserPrincipalName
    if ([string]::IsNullOrWhiteSpace($upn)) {
        $upn = "$samAccountName@uat.local"
    }
    
    # Prepare display name
    $displayName = if ([string]::IsNullOrWhiteSpace($user.Name)) { $samAccountName } else { $user.Name.Trim() }
    
    # Determine if account should be enabled
    $enabled = $user.Enabled -eq "TRUE" -or $user.Enabled -eq "True"
    
    try {
        New-ADUser -Name $displayName `
                   -SamAccountName $samAccountName `
                   -UserPrincipalName $upn `
                   -AccountPassword $defaultPassword `
                   -Enabled $enabled `
                   -PasswordNeverExpires $false `
                   -ChangePasswordAtLogon $true
        
        Write-Host "  Created: $samAccountName ($displayName)" -ForegroundColor Green
        $createdCount++
    } catch {
        Write-Host "  ERROR: Failed to create $samAccountName - $_" -ForegroundColor Red
        $errorCount++
    }
}

Write-Host ""
Write-Host "=== Import Summary ===" -ForegroundColor Cyan
Write-Host "Total processed: $($users.Count)" -ForegroundColor White
Write-Host "Created: $createdCount" -ForegroundColor Green
Write-Host "Already existed: $existingCount" -ForegroundColor Gray
Write-Host "Errors: $errorCount" -ForegroundColor Red
